import React from "react"


const Card = ({ response }) => {
    const {title, image} = response
    return (
        <div>
            <img src={`https://image.tmdb.org/t/p/w342/${image}.jpg`}  alt="" />
            <h1 className="tc white">{title}</h1>
        </div>
    )
}
export default Card
